INSERT INTO `tbl_course` (`id`, `title`, `des`, `img`, `path`, `time`, `teacher_id`) VALUES
(1, '嵌入式驱动开发环境搭建初级', '嵌入式系统的开发往往和PC上的开发不一样，那么本套课程将带着大家看看嵌入式开发中一些常用软件环境和服务的搭建情况。', '1.1嵌入式驱动开发环境搭建初级_btlDIHY.png', '', 0, 4),
(2, 'C语言语法概述	', 'C语言，是从事嵌入式开发人员必须掌握的重要工具，本套课程将重点围绕C语言的32个关键字，掌握其中使用它们的技巧和规律。', '1.2C语言语法概述_lgZo42M.png', '', 0, 4),
(3, 'C语言内存操作', '在C语言用，其核心和灵魂就是对内存类型资源的操作，这个操作的工具就是指针。本章课程嵌入式C语言高级内存空间RAM，将带领大家一起熟悉和掌握C语言指针的操作方法和思维方式。\r\n', '1.3C语言内存操作_uz5B0CW.png', '', 0, 4),
(5, 'C语言函数使用', 'C语言在本质上是函数的语言，我们使用的每个功能都是函数，因此在嵌入式应用开发中，我们对C语言的应用其实是对其函数的应用。如何运用函数，将是我们设计大型嵌入式程序的基础。\r\n', '1.4C语言函数使用_OVE9HoC.png', '', 0, 4),
(6, 'linux操作系统基础	', 'linux作为一款开源的操作系统，已经被大多数人所认可，在嵌入式领域中，linux的占用率一直稳居榜首，\r\n掌握好linux下的基本概念，对我们掌握系统编程及驱动开发都非常有利。', '1.5linux操作系统基础_d2l35tm.png', '', 0, 4),
(7, 'Java For Android', '进一步学习Android中常用的Java知识，包括：反射、内部类、泛型、多线程、Http网络编程等知识。', '5.1Java-for-android.jpg', '', 0, 5),
(8, '选修课 - 数据结构与算法', '数据结构课程描述：要想成为一名合格的计算机软件开发人员，必然要深入理解数据结构与算法。本套课程由美国Syracuse大学的老师带领大家掌握常用的数据结构和算法。\r\n', '5.7选修课_-_数据结构与算法.png', '', 0, 3263),
(9, 'Eclipse IDE 使用技巧', 'Eclipse IDE 是Java体系主流的集成开发环境，熟练掌握其使用是编程必备技能，本课程介绍Eclipse IDE开发工具的使用，快捷键，设置，技巧，代码阅读，调试等。', '1.4Eclipse-IDE-使用技巧.jpg', '', 0, 3288),
(10, 'Android 编码规范及代码风格', '好的编程规范和代码风格对编程至关重要，本课程讲解Java&Android中的编码规范和如何编写良好风格的代码。', '1.5-Android-编码规范及代码风格.jpg', '', 0, 5),
(11, 'SVN & Git 版本控制', 'SVN&Git在软件开发中经常使用，本章学习它们的使用背景、作用、用法等，以便在开发中进行版本控制，获取开源项目源代码，团队开发等。', '5.2SVN--Git-版本控制.jpg', '', 0, 5),
(12, 'Android App 开发环境搭建和配置', '介绍 Android App 开发环境搭建和配置操作。\r\n1、JDK&ADT (Bundle)的概念、如何获得、安装，安装目录介绍。\r\n2、配置JDK环境变量。\r\n3、Eclipse开发工具常规配置。\r\n4、Android SDK Manager&模拟器配置。', '1.1Android_App_开发环境搭建和配置.png', '', 0, 8),
(13, 'Android App开发起手式 - HelloWorld 二三事', '通过一个简单的Android App - HelloWorld，讲解如何新建Android Application Project、Project中的目录结构和文件有哪些，有什么用，有什么规范约束等等、Android 开发相关小工具DDMS、ADB、LogCat的使用，以及大致理解一个Project中各部件如何协同工作的。', '2.1.-Android-App-开发起手式-HelloWorld二三事.jpg', '', 0, 8),
(15, 'Android 基础UI控件', 'Android的UI控件是开发App应用程序界面设计的主要组件，一个商业级界面的制作，需要对android UI控件的熟练掌握和灵活使用。本章讲解Android界面开发中UI控件使用。', '2.3.-Android-的基础UI控UIkong.jpg', '', 0, 5),
(16, '秒学Swift开发语言，坐标系计算机语言学习法', 'Swift开发语言，无疑是目前最火的编程语言。不过你想知道如何秒学Swift语言么？你想知道如何深入理解这门语言么？你想知道如何不忘记这门语言么？你想知道如何秒学其他计算机编程语言么？本课程讲师Sundy带你进入一个学习计算机语言方法的全新世界 ，深入的掌握Swift语言 ，并且了解Swift的前世今生 ，深入浅出，引导你的思考和学习方法，一堂课的学习，终生的收益 ，这就是我们的课程风格。国内最与众不同的Swift课程，这套课程学完，其余语言也都通吃了。', '1.1秒学Swift开发语言坐标系计算机语言学.png', '', 0, 5),
(17, 'iOS8 App开发快速入门', '此为iOS应用开发职业课程系列的其中一套课程。让已经有swift语言基础的朋友快速掌握iOS开发的整个流程，并且做出自己的第一个Demo小例子 。麻雀虽小五脏俱全 。这个课程学完iOS开发流程和技术你就掌握了，后面无非就是再学习更多的Kit方法调用 。\r\n这套课程也是国内第一套基于swift语言的ios8应用开发课程 。 现在就开始 ， 快速掌握iOS8的基本开发吧 。', '1.3iOS8_App开发快速入门.png', '', 0, 5),
(18, 'iOS开发玩转界面-UIKit', 'UIKit框架是iPhone应用程序开发中最基本的框架，也是用得最多、最重要的框架，从名字我们就能理解是界面相关操作组件集合。本套课程系统全面的学习iOS界面组件UIKit，不但熟悉各个界面组件操作，更重要的是深入浅出的理解原理，实在是市面不可多得的iOS界面教学课程。', '2.1iOS开发玩转界面-UIKit.png', '', 0, 5),
(21, 'Linux文件IO操作	', '本章嵌入式应用开发常用技术Linux文件IO操作，将由麦子学院资深嵌入式应用开发工程师带你深入学习掌握文件的IO操作，让你体会Linux“一切皆文件”的设计特。', '2.1Linux文件IO操作_DKNyhBj.png', '', 0, 5),
(22, 'Linux应用开发之进程间通信	', '进程，程序灵魂的载体，掌握了linux的进程及特性，以及他们之间的信息传递，将是成为一名合格的linux应用开发工程师必须的技能。', '2.2Linux进程间通信_90qJDLw.png', '', 0, 5),
(23, 'iOS多线程及异步任务处理', '学习iOS多线程开发和异步任务处理 ， 会学习到NSThread ， TaskQueue，Runloop，GCD等 ， 也会学习在商业项目中哪些功能我们需要用多线程和异步任务，从而达到优秀的质量 。 ', '3.2iOS多线程及异步任务处理.png', '', 0, 2212),
(25, '普及课 - ARM开发板基础知识', '嵌入式驱动开发学习中，对于硬件零基础，我们如何认识一款ARM开发板呢？让我们跟着视频一点一点熟悉什么是ARM开发板。', '3.1选修_-_ARM开发板基础知识.png', '', 0, 5),
(26, 'iOS网络编程', '学习如何在iOS开发中用到网络通信 ，包括BSD套接字，CFNetwork framework，Foundation framework API，CFURL 等 ，我们会重点以HTTP协议来熟悉iOS网络编程相关知识', '3.1iOS网络编程.png', '', 0, 6502),
(27, 'ARM汇编语言', '学习ARM，首先要了解ARM的工作原理，那么对ARM汇编的理解，将是我们理解ARM体系结构最好的敲门砖。', '3.2选修_-_ARM汇编语言.png', '', 0, 5),
(28, 'ARM硬件开发基础', '独木不成林，嵌入式驱动开发学习中，只是理解了ARM的结构，系统还是无法使用，下面我们将了解芯片中的一些简单控制器，来看看系统是如何展现给我们的。', '3.3选修_-_ARM硬件开发基础.png', '', 0, 5),
(29, 'ARM Bootloader开发', '对于嵌入式驱动开发，掌握了简单的硬件操作，但还不够，一旦系统变得复杂多变时，我们只靠一些简单的汇编是无法开发大型系统的，那么本课程将带着大家掌握如何一步一步写出ARM下的bootloader子功能。', '3.4ARM_Bootloader开发_f6TPFQr.png', '', 0, 4),
(30, 'ARM硬件接口开发', '嵌入式驱动开发中，有了bootloader，我们可以放心的开发更复杂的接口了，helloworld是怎么在底层跑起来那，看起来不像printf那样简单...', '3.5ARM硬件接口开发_uUa4yrX.png', '', 0, 4),
(31, 'iOS多媒体编程', '学习iOS的音频视频编程的各个方面 ，包括上层的类似于MPMoviePlayerViewController类的学习 ，以及底层的CoreAudio等学习等等 。课程学完后能独立开发出高质量的音频和视频程序 。', '3.3iOS多媒体编程.png', '', 0, 8782),
(32, '探寻嵌入式系统移植的世界', ' 嵌入式底层驱动学习的前提，是要将我们的开发板上运行起linux操作系统，那么本课程将由麦子学院资深嵌入式开发工程师王海宁老师带领大家学习如何移植系统三大组件的步骤，bootloader，linux内核，文件系统的过程。', '4.1探寻嵌入式系统移植的世界_PtsUqDf.png', '', 0, 4),
(33, 'iOS地理位置及定位系统', '学习包括MapKit等与定位及地图相关的应用开发', '3.4iOS地理位置及定位系统.png', '', 0, 8783),
(34, '看懂uboot的神秘面容', '这套“看懂uboot的神秘面容”课程，其目的在于通过对一个优秀的bootloader软件的全过程分析，一步步如抽丝剥茧般带你领略嵌入式开发所涉及的系统启动部分涉及的概念和相关硬件的原理。包括CP15、UART、DDR2这些系统启动必须掌握的设备信息。', '4.2看懂uboot的神秘面容_W0LtJiA.png', '', 0, 2027),
(38, 'linux字符设备驱动初探', 'Linux字符设备驱动程序是Linux下被组织为一组完成不同任务的函数的集合，通过这些函数使得linux的设备操作犹如文件一般。本章就由麦子学院嵌入式开发名师带领大家一起学习linux字符设备驱动相关知识，赶快开始学习吧。\r\n', '4.4linux字符设备驱动初探_kpaklhQ.png', '', 0, 6693),
(42, 'linux下输入子系统', '在嵌入式开发中，Linux输入子系统是由输入子系统设备驱动层、输入子系统核心层(Input Core)和输入子系统事件处理层(Event Handler)组成。本章我将一起学习input子系统的相关知识，了解Linux输入子系统的核心原理。\r\n', '4.6linux下输入子系统_IEgCGZf.png', '', 0, 6693),
(45, 'linux下网卡设备驱动', '学习嵌入式驱动开发，本章将由麦子学院嵌入式资深讲师，带你一起学习linux下设备驱动相关知识，掌握DM9000驱动相关知识。\r\n', '5.3linux下网卡设备驱动_lTj2KpF.png', '', 0, 6693),
(54, '选修-敏捷开发软件工程', '学习软件开发流程，掌握使用UML，并且以WRUP软件工程模型为基础，进行软件开发规范化和团队管理的实操！', '5.3选修-敏捷开发软件工程.png', '', 0, 5),
(55, 'Android 项目实战一：AA小助手', '在学习完成Android的Activity和一些常用android UI控件后，我们以一个小android项目实战来练习我们学习的内容，目的在于：锻炼布局、熟练掌握常用控件的使用，控件的数据绑定，Activity的生命周期，Activity跳转，Activity间传递数据。', '2.4.-实战项目一.jpg', '', 0, 3288),
(56, 'Android Service & Broadcast', 'Service和Broadcast是Android的四大件之一，在Android开发中经常使用。本课程将讲解Service和Broadcast的应用场景，使用规则，如何在App开发中使用他们。', '3.1.-Android-Service--Broadcast.jpg', '', 0, 5),
(59, 'Android 多线程与异步任务', '本课程将学习Android编程中的多线程和异步任务相关操作，帮助学员理解、掌握android多线程、android异步任务相关理论知识的同时，也能将这些理论运用于具体实践。', '3.4..-Android-多线程及异步任务.jpg', '', 0, 8),
(61, 'Android 应用部署与发布', 'android应用发布程序让你的劳动成果公布于世，打包和发布是这个神圣动作的必备步骤。本课程介绍了android应用部署与发布中的打包程序时的混淆技术，反编译和防止反编译技术。手动打包和Ant脚本打包的介绍，详细说明版本名称和版本代号的作用，说明签名文件的作用。介绍批量打包的版本，将android程序发布到各大安卓市场上。', '4.1.-Android-应用部署与发布.jpg', '', 0, 3270),
(62, 'Android 主题及动画的实现', 'android的主题、自定义样式以及动画的实现', '3.6Android_主题及动画的实现.png', '', 0, 8),
(64, 'Android Camera & Recoder', 'Android Camera拍照|Recoder录像功能的开发要点和技巧。 ', '5.3.-Android-Camera--Recorder.jpg', '', 0, 3262),
(65, 'Android 多媒体', '学习Android的音频和视频播放。', '5.4.-Android-多媒体.jpg', '', 0, 5),
(66, 'Android 传感器 Sensor', 'Android中各种传感器:重力、加速度、方向、光线的使用方法。', '5.5.-Android-传感器-Sensor.jpg', '', 0, 3262),
(67, 'Android 社会化分享', '学习Android的中社会化分享技术的实现，包括：各大平台官方实现、第三方框架实现，社会化分享数据统计。', '5.7.-Android-社会化分享.jpg', '', 0, 3261),
(68, 'Android 消息推送', '随着移动互联网的不断发展，Android开发成为了大多数程序员选择的对象，但是非常多的人都是半路出家，根本就不明白Android开发其中的一些原理以及实现的方法，只是能够片面性的运用别人写好的代码。\r\n因此：本套视频教程将从实践的角度带你学习Android推送的知识。在使用中理解Android推送的原理。通过对Android推送基本原理的了解，进一步的熟悉三方平台推送库，从更多的方面理解和学习Android的推送。\r\n', '5.8.-Android-消息推送.jpg', '', 0, 15571),
(69, 'Android 定位技术 LBS', '本课程学习Android中LBS定位技术的实现。', '5.9.-Android-定位系统-LBS.jpg', '', 0, 4859),
(70, 'Android NDK 初步', '本课程学习Android的NDK和JNI的技术使用。', '5.10.-Android-NDK初步.jpg', '', 0, 5),
(71, 'Android 电话与短信应用', '本课程学习Android中电话和短信的使用。', '5.11.-Android-电话与短信应用.jpg', '', 0, 5),
(72, 'Android Launcher & Widget', '本课程学习Android中Launcher和Widget的使用。', '5.12.-Android-Launcher--Widget.jpg', '', 0, 5),
(82, '选修 - ARM开发板基础知识', 'ARM开发板，嵌入式开发常用工具之一，以英国ARM（Advanced RISC Machines）公司的内核芯片作为CPU，同时附加其他外围功能的嵌入式开发板，用以评估内核芯片的功能和研发各科技类企业的产品。本节将由麦子学院高级嵌入式开发工程师带你进入ARM开发板的世界，让你从一点一滴开始熟悉ARM开发版。\r\n\r\n', '3.1选修_-_ARM开发板基础知识_BoA6mYW.png', '', 0, 4),
(83, '选修 - ARM汇编语言', '独木不成林，只是理解了ARM的结构，系统还是无法使用，本章我们将学习ARM汇编语言，了解芯片中的一些简单控制器，来看看系统是如何展现给我们的。', '3.2选修_-_ARM汇编语言_dc28YKd.png', '', 0, 4),
(84, '选修 - ARM硬件开发基础', '嵌入式开发，软件与硬件的结合，了解完ARM的结构后，我们还需要对ARM硬件的开发进行一些了解，本节将由麦子学院资深嵌入式开发工程师，带你了解芯片中的一些简单控制器，玩转嵌入式ARM开发。\r\n', '3.3选修_-_ARM硬件开发基础_NNABRNo.png', '', 0, 4),
(92, '嵌入式C语言高级---语法概述', 'c语言，物联网开发基础语言，是从事物联网开发人员必须掌握的重要工具，本章c语言语法概述将由麦子学院资深物联网开发工程师王海宁老师为大家讲解C语言所包含的32个关键字，及其在物联网中的应用技巧与规律。\r\n', '1.1嵌入式C语言高级---语法概述.png', '', 0, 4),
(93, '嵌入式C语言高级---内存空间', '在物联网开发中，C语言的核心和灵魂就是对内存资源的操作，而在开发中，这个操作的工具就是指针，本章麦子学院物联网资深工程师将带领大家一起来学习掌握C语言及其指针工具的使用。\r\n\r\n', '1.2嵌入式C语言高级---内存空间.png', '', 0, 4),
(94, '嵌入式C语言高级---函数空间', '物联网开发中所运用的C语言其本质是一个函数语言，其编写的每个功能都是一个函数。在物联网开发中，如何运用C语言的函数，是设计大型物联网程序的必要基础。\r\n', '1.3嵌入式C语言高级---函数空间.png', '', 0, 4),
(98, '物联网之ucos操作系统基础', '物联网之ucos操作系统基础', 'ucos操作系统基础.jpg', '', 0, 33547),
(103, '互联网发展和基础', '工欲善其事必先利其器，从事产品经理的工作怎么不先了解互联网的发展历程呢？本部分课程带领大家从最容易记忆的概念和指标入手，伴以常见产品发展案例，将产品及产品经理相关概念做以介绍。', '1.1-互联网发展和基础.jpg', '', 0, 46),
(104, '互联网产品及产品经理', '学习从多个维度分析和研究产品，进而从多个角度来思考如何打造自己的产品。产品经理是什么样的角色，做出来的产品如何评价和判断优劣？产品经理的发展轨迹是什么样的？本部分将做以介绍，做到有的放矢。', '1.2part2-互联网产品及产品经理.jpg', '', 0, 46),
(105, '互联网产品的商业模式', '商业模式是产品经理构建产品的基石，互联网产品的的各种商业模式都有哪些，了解了这些商业模式，做产品或者研究产品才能透过现象看本质。', '1.3part3-互联网产品的商业模式.jpg', '', 0, 46),
(106, '产品的商业模式画布', '学习产品商业模式画布中的元素，能够更好地看待产品、资源、目标，学习如何结构化的分析整理自己的资源，构建整个产品的大的结构。', '1.4part4-产品的商业模式画布.jpg', '', 0, 46),
(107, '互联网思维', '互联网产品发展日新月异，在各种形态的产品背后，有哪些思维方式在发挥作用，从一定高度让大家学习如果将抽象思维转化为产品实体，把握关键脉络和互联网思维方式，顺应趋势打造产品。', '1.5part5-互联网思维.jpg', '', 0, 46),
(108, '流程图', '产品经理梳理过程的利器——流程图，如何绘制流程图，如何组织要绘制的节点内容，用哪些工具可以更有效地绘制流程图，本部分产品流程图课程将深入浅出的带领大家实际训练起来。', '2.1part6-流程图.jpg', '', 0, 46),
(109, '需求分析及BRD', '产品经理日常工作会产出的需求和想法，这些需求和想法如何管理，如何传递，如何组织，本部分课程带领大家学习需求的管理和BRD的撰写，开始完成第一个重要的文档。', '2.2part7-需求分析及BRD.jpg', '', 0, 46),
(110, '市场需求文档MRD', '本部分课程将学习重要的规划型的产品市场需求文档，其中如何分析市场、如何分析用户、如何构建产品目标、如何进行项目规划，都将进行深入浅出的学习。', '2.3part8-市场需求文档MRD.jpg', '', 0, 46),
(111, '产品功能需求文档PRD', '产品经理日常工作中，具体的产品功能需求文档的撰写如何进行，包括哪些部分内容，如何描述功能，本课程将以实际的案例进行讲解如何完成产品PRD。', '2.4part9-产品功能需求文档PRD.jpg', '', 0, 46),
(112, '竞品分析', '关注竞品进行分析是产品经理日常工作的重要部分，本部分课程将完整的介绍竞品分析如何组织，有哪些方法，以什么样的形式呈现，配合实际案例做全面的介绍。', '2.5part10-竞品分析.jpg', '', 0, 46),
(113, '数据分析', '产品数据分析是产品经理工作的重要组成部分，依据数据变化来调整产品是有效的工作方式，如何进行产品数据分析，分析哪些数据，怎么转化数据未行动，本部分课程都将进行介绍。', '3.1part11-数据分析.jpg', '', 0, 46),
(114, '产品运营', '产品不仅需要设计还需要运营，产品运营是在做什么，有哪些方式，对产品能起到什么作用，如何做产品运营，本部分课程将带领大家进行学习。', '3.2part12-产品运营.jpg', '', 0, 46),
(115, 'Web端产品设计', '产品是用来满足用户的，以用户为中心的产品设计如何进行，在整个产品设计过程中有哪些关键点，交互设计、视觉设计如何发挥作用，本部分课程将深入学习。', '3.3part13-产品设计.jpg', '', 0, 46),
(228, 'HTML5+CSS3快速入门', 'HTML5+CSS3是web前端开发的常用基础语言之一，本章将分别从html5相关元素及应用、css3相关元素及应用及html5+css3实战等方面进行介绍，快速入门html5+css3。', '1.2Web前端开发之HTML5CSS3快速入门.jpg', '', 0, 1472),
(229, 'Javascript初步', 'Javascript是web前端开发常用技术之一，也是web前端开发必学技术之一，本章麦子学院原创JavaScript视频教程，将围绕其相关基础知识和实际应用全面讲解，让你轻松掌握并精通JavaScript的使用。', 'javascript.jpg', '', 0, 4290),
(230, 'Web前端开发之Ajax初步', '麦子学院原创web前端开发常用技术 — ajax视频教程， 主要从ajax的运行环境、元素的应用、及其数据类型的运用等方面进行介绍和实战，让学员能快速入门并精通ajax的使用。\r\n', '1.4Web前端开发之Ajax初步_dzETH8z.jpg', '', 0, 1161),
(231, 'Photoshop切片', 'Photoshop切片是web前端开发常用技术之一，本章将由麦子学院资深web前端工程师为你讲解ps切片的基本操作、技巧及要点，让你快速入门Photoshop切片。\r\n', '1.5Web前端开发之Photoshop切片.jpg', '', 0, 1470),
(232, 'Web前端开发之jQuery入门课程', 'JQuery — web前端开发的另一常用技术，本章将从理论基础+实战演练两方面对JQuery相关应用进行全面讲解，让你轻松学习JQuery 。', '1.6Web前端开发之jQuery入门课程.jpg', '', 0, 1393),
(233, '前端开发项目：一起来做秒杀活动', '通过使用HTML5+CSS+JS技术进行秒杀活动前端开发项目实战演练达到熟练掌握的程度。', '2.1前端开发项目--一起来做秒杀活动.jpg', '', 0, 1161),
(234, '选修-XCode详解及iOSApp上传', '学习如何安装和使用XCode以及iOS的App应该如何上传到app store上。', '5.4选修-XCode详解及iOSApp上传.jpg', '', 0, 1484),
(235, '选修-Objective-c之iOS开发入门实战', '大富翁作者，硅谷柯博文老师给大家带来的objective-c语言与IOS开发实战入门课程，全面讲解iOS开发环境搭建、iOS开发工具的使用及相关函数、类的用法。', '5.5选修-Objective-C的重点难点分析-拷贝.jpg', '', 0, 1481),
(236, '选修-Objective-C的重点难点分析', '针对objective-c编程语言入门之后的重点难点知识讲解， 包括Objective-C内存管理 、 Block 、Objective-C 可变序列、Objective-C可变字典等等，轻松掌握Objective-C开发语言重难点知识。', '5.2选修-Objective-C的重点难点分析.jpg', '', 0, 1484),
(256, 'android架构师需要掌握的OOP及架构分析', '本章主要由麦子学院Android资深名师高焕堂老师，为大家讲解android架构师需要掌握的OOP知识及其架构分析，为想成为Android架构师的你奠定基础。', '1.1android架构师需要掌握的OOP及架构分析.png', '', 0, 2021),
(257, 'android架构之EIT介绍', 'EIT造形是一种基本的结构(Structure)，一种概念(Concept)，是Android架构师常用技术之一，本章高焕堂老师将为你详细讲解EIT造形相关应用，让我们一起探索单一造形所创造出来的整体之美。', '1.2android架构之EIT介绍.png', '', 0, 2021),
(258, 'android架构之设计模式介绍', '麦子学院原创android架构之设计模式课程，全面讲解Android架构设计中的常用模式，与初入门架构设计的你一起探索Android领域。', '1.3android架构之设计模式介绍.png', '', 0, 2021),
(259, 'android架构之认识框架', '要想成为一名android架构师，认识android框架非常有必要，通过本章学习，你将可全面掌握android 的java应用层框架。\r\n', '2.1android架构之认识框架.png', '', 0, 2021),
(260, 'android架构之认识进程与IPC架构', 'android中的IPC的基本模型是基于客户/服务器(C/S)架构的，学习本章麦子学院原创IPC架构课程，将使你对IPC架构有更全新的认识，同时对相关知识的掌握度也更加深入。', '2.2android架构之认识进程与IPC架构.png', '', 0, 2021),
(261, 'android架构之认识线程模式', '线程是android架构中常用的重要模式之一，也是android架构师必须掌握的技术之一，本章就由麦子学院的高焕堂老师带大家一起来认识认识什么是android架构的线程模式。', '2.3android架构之认识线程模式.png', '', 0, 2021),
(262, 'android架构之UI框架及多线程', 'android架构设计中，架构很重要，UI也同样重要，通过学习本章UI框架及多线程相关知识，将助你设计出更完美的android界面。\r\n', '2.4android架构之UI框架及多线程.png', '', 0, 2021),
(263, 'android架构之AIDL与Proxy-Stub设计模式', 'AIDL与Proxy-Stub设计模式是android架构的另一个重要技术，学习此课程，将使你更全面的掌握android架构设计所需相关技能技巧。', '2.5android架构之AIDL与Proxy-Stub设计模.png', '', 0, 2021),
(264, 'android架构之IBinder与IMessager', '本章android架构设计的IBinder与IMessager接口，麦子学院遵循敏捷的迭代过程，从思想、方法、模式、范例和成功案例各种不同角度，带你学习从设计到代码的途径，让你迅速熟悉并能熟练使用这两个接口。\r\n', '2.6android架构之IBinder与IMessager.png', '', 0, 2021),
(265, 'android架构之JNI详解', '上层Java要调用底层的C/C++函数库必须通过Java的JNI来实现，本章我们将一起学习Android架构JNI的原理、接口、函数、设计等等，一起探索Android是如何通过JNI来实现Java对C/C++函数的调用的。', '2.7android架构之JNI详解_gLi8KF4.png', '', 0, 2021),
(266, 'android架构之Java线程篇', '本章android架构设计得java线程，将从多个java纯种进入本地函数和本地线程进入java层两个方面进行详细的理论+实践学习，全面掌握java线程的运用。\r\n', '2.8android架构之Java线程篇.png', '', 0, 2021),
(267, 'android架构之复习问题集', 'Android架构历练的第二个阶段，框架原理及架构学习已告一段落，对于学习中存在的一些问题，本章将统一讲解，我们一起来看看吧。\r\n', '2.9android架构之复习问题集.png', '', 0, 2021),
(268, 'android架构之核心服务', '麦子学院原创android架构核心服务课程，由android名师高焕堂老师主讲，带你打入android架构的核心区域。', '3.1android架构之核心服务.png', '', 0, 2021),
(269, 'android架构之Proxy-Stub设计模式', 'Android架构开发的Proxy-Stub设计模式课程，将从Proxy-Stub设计模式的基本概念、Proxy-Stub设计模式实战练习、及其与其他Android架构重要接口的联系几个方面进行讲解，全让你轻松掌握框架通用性接口的设计。', '3.2android架构之Proxy-Stub设计模式.png', '', 0, 2021),
(270, 'android架构之HAL', 'Android的HAL是为了一些硬件提供商提出的“保护proprietary”的驱动程序而产生的，简而言之，就是为了避开linux kernel的GPL license的束缚，因此在Android架构的学习中，HAL学习也是非常有必要的，我们一起来学习吧。', '3.3android架构之HAL.png', '', 0, 2021),
(271, 'android架构之观摩Session模式与Proxy-Stub模式的搭配', 'android架构设计中，借鉴其他好的技术是必要的，本章就带领大家一起观摩Session模式与Proxy-Stub模式的搭配。', '3.4android架构之观摩Session模式与Proxy-.png', '', 0, 2021),
(272, 'android架构之几个组件框架的设计', 'android架构的设计离不开框架的设计，本章高焕堂老师将带领大家一起学习android架构的几个常用小框架，并和大家一起动手进行框架设计。\r\n', '3.5android架构之几个组件框架的设计.png', '', 0, 2021),
(273, 'android架构之接口设计之美', 'android架构的设计离不开对接口的设计，本章高焕堂老师就将带领大家一起学习接口设计相关知识及应用，共同领略android接口设计的美妙。', '3.6android架构之接口设计之美.png', '', 0, 2021),
(274, 'Android A段架构师应该具备什么', '作为android架构师，不仅要精通android开发相关技术，同时还需具备商业思维、创业思维及一定的战略战术等等，本章我们就来具体看看Android A段架构师除了技术知识，还应该具体具备什么。', '4.1Android_A段架构师应该具备什么.png', '', 0, 2021),
(275, 'UIKit-表格，集合和控制器', '本章主要是iOS开发中，学习UIKit表格相关知识，掌握集合和控制器的原理，深入理解iOS UI组件的使用技能、技巧。', '2.2UIKit-表格集合和控制器.png', '', 0, 5),
(276, 'Python语言编程基础', 'Python是一种面向对象、解释型计算机程序设计语言，语法简洁而清晰，具有丰富和强大的类库。本章Python编程基础的视频教程，为现目前国内最全面的Python视频教程之一，由麦子学院资深Python工程师录制，主要围绕Python编程实战方方面面展开。', '1.5Python语言编程基础.png', '', 0, 2023),
(279, '人物头像的核心分析 头骨结构与素描的绘制', '本章主要是游戏原画设计素描基础之头骨素描的绘制方法及要点讲解，帮助原画初学者快速掌握头骨绘制相关知识。', '2.2.png', '', 0, 3287),
(281, ' 角色原画的面部塑造方式 传统人物切面像的绘制', '本章游戏原画石膏面相的绘制学习，主要从面相的绘制理论知识、切面相绘制、面相绘制三个方面进行详细介绍，让原画初学者快速掌握石膏面相的绘制相关知识。', '2.3.png', '', 0, 3287),
(282, '头部的结构与表现核心 传统石膏像的绘制', '本章主要是游戏原画设计入门学习之石膏像的绘制，从石膏像绘制的理论和实际操作出发，让学员轻松掌握绘制石膏像的技能技巧。', '2.4.png', '', 0, 3287),
(284, '角色原画的色彩塑造 色彩人物肖像绘制', '本章主要是游戏原画设计学习初级阶段之色彩人物肖像写生，主要从结构分析、素描绘制、色彩绘制三个方面进行了详细的讲解，让原画初学者能快速上手。\r\n', '2.5.png', '', 0, 3287),
(288, '概念设计流程 角色设计的概念剪影与草图的绘制', '掌握概念设计当中比较通用的从剪影开始的设计方式与思路。', '3.2.png', '', 0, 3287),
(289, '从设计到绘画表现 角色设计的色彩与上色绘制', '从设计到绘画表现 角色设计的色彩与上色绘制。', '3.3.png', '', 0, 3287),
(290, '刻画能力培养 材质绘制专题 (材质球的绘制)', '材质与材质球绘制。', '3.5.png', '', 0, 3287),
(291, '刻画范围 材质绘制专题（材质的绘制范例）', '材质的绘制范例。\r\n', '3.6.png', '', 0, 3287),
(292, '角色绘制能力培养 线稿绘制基础', '运用体块分析的方式绘制人物线稿 贯穿整个概念设计的学习过程。', '3.1.png', '', 0, 3287),
(293, '商业级别原画创作思路 世界观架构设计与分析 ', '商业级别原画创作思路 世界观架构设计与分析 ', '4-1.jpg', '', 0, 3287),
(294, '商业级原画创作讲解示范 武器类设计&绘制', '商业级别原画创作思路讲解与示范 武器类设计&绘制\r\n', '4-2_ATFbXIL.jpg', '', 0, 3287),
(295, '商业级原画创作讲解示范 套装类设计&绘制 ', '商业级别原画创作思路讲解与示范 套装类设计&绘制 ', '4-3.jpg', '', 0, 3287),
(296, '商业级原画创作讲解示范 角色类设计&绘制 ', '商业级别原画创作思路讲解与示范 角色类设计&绘制 ', '4-4.jpg', '', 0, 3287),
(302, 'Javascript初步', 'javascript是一种动态类型、弱类型、基于原型的语言，广泛应用于客户端，而在Python中，JavaScript是 web前端开发不可或缺的一个技术，本章主要是麦子学院资深web前端开发工程师通过系统讲解js的语法、对象、函数、变量及其的使用等等，让零基础学员迅速入门。', 'javascript_kvRO4x3.jpg', '', 0, 4290),
(305, 'ajax入门', 'ajax是一种创建交互式网页应用的网页开发技术，通过在后台与服务器进行少量数据交换，AJAX 可以使网页实现异步更新。该技术也是web前端开发常用技术之一，本章将由麦子学院资深讲师系统为您讲解ajax技术的使用方法。', '2.4Web前端开发之Ajax初步.jpg', '', 0, 1161),
(307, 'django基础', 'Django是一个卓越的新一代Web框架，是用 Python 编写的一组类库。本章django基础主要是麦子学院资深Python工程师对django创建网站、URL配置、模板、数据库等实战应用的讲解，运用django开发网站，你的web开发将充满更多的乐趣。', '2.2django基础.png', '', 0, 3472),
(308, 'django进阶', 'django进阶，通过本门课程，希望大家掌握django的快速、高效，在实践中能够使用这些知识，加速构建项目。当然，也希望通过这门课程让大家真正的爱上django。', '2.3django进阶.png', '', 0, 93185),
(309, '项目实战：Django个人博客系统', '项目实战。', '2.8django个人博客系统.jpg', '', 0, 3472),
(310, 'django项目部署', '项目部署。', '2.6django项目部署.jpg', '', 0, 56564),
(311, 'django缓存优化', '这是一门Django缓存优化框架解析与项目实战课程，目标是深入解析Django缓存优化原理、方式及配置方法。从整体到局部，再到整体的方式逐步介绍Django缓存优化框架。并通过丰富的项目演示来展示Django缓存的实际使用与效果。从而让学员能够全面掌握Django缓存优化框架，熟练配置和使用Django缓存系统。', '2.5django缓存优化.png', '', 0, 33913),
(312, 'Linux基础', 'linux基础', '4.4Linux基础.png', '', 0, 4),
(313, 'Flask入门', '本视频教程将从基础入手，全面地了解 Flask 的能力将你引领进入“微”框架世界，并通过实践向你展示 Flask 在 Web 开发中的 “简洁而不简单” 的威力。', '4.3Flask入门.jpg', '', 0, 39460),
(314, 'python-Tornado ', '这是一门使用python Tornado框架进行web开发的实战课程，课程通过一个blog网站的开发为主线，对Tornado框架的使用方法进行了详细讲解，目标是使学员能熟练掌握 Tornado框架。', '2.7Tornado入门.png', '', 0, 43149),
(319, '从零打造一款社区web产品', '通过产品经理课程的学习，开展实际训练，运用之前课程中的方法和工具，完整的进行产品的设计流程和整体规划，对产品经理工作中的各个环节进行梳理形成全面认识，从0打造一款社区web产品。', '4.1从零打造一款社区web产品.png', '', 0, 46),
(320, '从零打造一款工具app产品', '通过产品经理理论知识的学习，进行实际训练，运用之前课程中的方法和工具，完整的进行产品的设计流程和整体规划，对产品经理工作中的各个环节进行梳理形成全面认识，从零打造一款工具app产品。', '4.2从零打造一款工具app产品.png', '', 0, 46),
(321, '怎么做一款O2O互联网产品', '通过实际训练，运用之前课程中的方法和工具，完整的进行O2O互联网产品的设计流程和整体规划，对产品经理工作中的各个环节进行梳理形成全面认识。', '4.3怎么做一款O2O互联网产品.png', '', 0, 46),
(325, 'Html5+css3', 'Html5+css3为php开发中，前端必会技术之一。该章课程为现目前国内最完整的html5+css3课程，由麦子学院资深前端开发工程师朱朝兵老师为你全面讲解，让你体会不一样的前端开发。', '4.2Web前端开发之HTML5CSS3快速入门.jpg', '', 0, 1472),
(326, 'Javascript初步', 'php 前端开发最重要的语言之一，学完本章，你将能熟练掌握和使用Javascript相关知识，制作出更加完美的php网站。\r\n', 'javascript_z3A0eTM.jpg', '', 0, 4290),
(328, 'ajax入门', '本章主要是php开发入门，前端设计必会语言之一ajax的介绍，掌握本课程的相关知识，将助你开发出更适合客户视觉体验的php网站。\r\n', '1.4Web前端开发之Ajax初步.jpg', '', 0, 1161),
(332, 'Smarty模板引擎', '从Smarty的主页可看出，Smarty是PHP开发的"半官方"的模板化引擎。它是在GNU宽通用公共许可（LGPL）下发布的，是最流行、功能最强大的PHP模板化引擎。', '2.4Smarty-模板引擎.jpg', '', 0, 4290),
(337, 'Redis入门', ' Redis是一个key-value存储系统，是php开发中重要技术之一，本章将由麦子学院资深php开发工程师为你讲解 Redis的安装、配置、命令等相关内容，让你轻松入门 Redis。', '4.5Redis入门.png', '', 0, 4290),
(341, '架构师的成长的十个步骤', 'android架构师不仅要有过硬的android开发技术，还需要具备本章课程中讲到的十个步骤，至于这十个步骤具体是什么，我们一起来看看下面的android架构设计课程吧。', '4.2架构师的成长的十个步骤_qVYXYb9.png', '', 0, 2021),
(342, 'node.js上最新HTML5开发框架-Meteor', 'node.js上最新HTML5开发框架-Meteor 是一组新的技术用于构建高质量的 Web 应用，提供很多现成的包，可直接在浏览器或者云平台中运行。本章Meteor的学习，由麦子学院资深Python开发工程师为你系统的讲解，助你迅速掌握Meteor编程的各个要点。', '4.7node.js上最新HTML5开发框架-Meteor.png', '', 0, 4860),
(346, 'IOS多点触控与手势识别', 'IOS多点触控与手势识别', '2.4OS多点触控与手势识别.png', '', 0, 5),
(350, 'Java Web基础-JDBC', 'JDBC-Java操作数据库的规范（接口）。本节课程主要由Java资深工程师介绍jdbc接口的学习，及通过jdbc加载具体的驱动，实现对Java数据库的操作。\r\n\r\n', '2.5Java_Web基础-JDBC.png', '', 0, 1482),
(351, 'Web前端开发之Ajax初步', 'AJAX 一种创建快速动态网页的技术，本课程将全面介绍其在Java  web开发中的应用，让你体验动态网页在Java前端开发中的巧妙运用。\r\n', '2.7Web前端开发之Ajax初步.jpg', '', 0, 1161),
(352, 'Web前端开发之HTML5+CSS3快速入门', 'Java  web前端开发常用技术之一，可快速构建极具客户体验度的应用。本课程由有着多年实战开发的资深web前端开发工程师朱朝兵老师为大家录制，从html5+css3基础知识，到实战案例分析，实际操作，均有详细讲解。\r\n', '4.1Web前端开发之HTML5CSS3快速入门.jpg', '', 0, 1472),
(354, 'Web前端开发之jQuery入门课程', 'JQuery作为java  web前端开发主要技术之一，是java开发中必须掌握的基础知识。本章将由硅谷资深JQuery工程师全面系统为您讲解其相关知识体系并通过案例形象展示其使用方式方法。', '1.3Web前端开发之jQuery入门课程_Qb7jYcv.jpg', '', 0, 1393),
(355, '项目实战：学生成绩评测系统 ', '本节主要是利用Java开发学生成绩测评系统的项目实战演练，将理论知识全面运用到实战中，活学活用，提升学员实战能力，同时侧重讲解实战中需注意的Java开发各种重难点知识。\r\n', '2.8学生成绩评测系统.jpg', '', 0, 14083),
(357, 'Java Web进阶-Mybatis', 'Mybatis数据库映射框架中的一把半自动步枪，最易上手的ORM框架。\r\n通过Mybatis可以快速的让SQL完美运行在各类JAVA数据库应用项目中。\r\n本套视频教程将从实践的角度带你学习Mybatis框架。在使用中理解Mybatis的设计思想、理解如何在项目中灵活使用Mybatis。\r\n', '4.4Java_Web进阶-Mybatis.png', '', 0, 6781),
(359, 'Java Web进阶-Oracle', 'Oracle实战授课，深入掌握原理+大量实战案例+SQL优化方法介绍，让数据库高手之路，从这里开启。', '3.4Java_Web进阶-Oracle.jpg', '', 0, 1482),
(360, 'JAVA项目实战-嗨购网上商城', '本套视频主要讲解使用当前流行的Java开源框架Strus2，Spring，MyBatis结合jQuery完成电子商务网站。完成本视频的学习之后，可以掌握当前Strus2，Spring与MyBatis开发基于Java EE的网站或企业级应用，并且对电子商务的业务流程有所了解。', '3.5java项目实战海购网上商城.jpg', '', 0, 17634),
(361, 'Java Web扩展-Jsf', 'JSF是SUN制定的规范，真是有许多独具匠心的妙处。JSF更为简单，也更容易学习及上手。由于其与生俱来的扩展性及良好的设计，在大规模的应用中，将会体现出更多的好处，未来它将包含在J2EE规范中。\r\n本套视频教程案例式教学带你玩转JSF，可以让你对JSF知其然更知其所以然。\r\n', '4.2Java_Web扩展-Jsf.png', '', 0, 14083),
(362, 'Java Web扩展-Freemarker', '本套视频介绍了最流行的Java开源模版引擎FreeMarker。利用它，开发人员可以方便的实现页面静态化的功能，同时也能够用于产生XML,Java源代码等。', '4.3Java_Web扩展-Freemarker.png', '', 0, 17634),
(364, 'Java Web扩展-Weblogic', 'Weblogic', '4.5Java_Web扩展-Weblogic.png', '', 0, 33515),
(365, 'Java Web基础-servlet', 'Java Servlet是一个专门用于编写网络服务器应用程序的Java组件，是Java开发的基础语言。本节将由麦子学院在资深Java开发工程师从理论+实践，全面介绍Java Servlet知识体系。\r\n', '2.3Java_Web基础-servlet.png', '', 0, 1482),
(366, 'Java Web基础-JSP', 'JSP为Java  Web开发基础课程，本节麦子学院原创高端JSP课程将由资深Java工程师从标签、对象、数据库的访问、表达式等方面详细介绍JSP相关知识及其操作方法。', '2.4Java_Web基础-JSP.png', '', 0, 1482),
(367, 'Java Web基础-Tomcat', 'Tomcat  Java 中开发和调试JSP 程序的首选，本节将从tomcat的安装配置方法、优化方法及内存等方面进行讲解，全面剖析tomcat的操作要点。', '2.6Java_Web基础-Tomcat.png', '', 0, 1482),
(368, 'linux驱动策略及框架', '本课程针对那些对linux驱动有兴趣或者有需求要从事这一块、但不知道从何入手的开发人员，几乎囊括了linux下的所有类型的驱动，包括platform驱动、usb驱动、pci驱动、framebuffer驱动、网卡驱动等，同时穿插linux内核中的各种机制比如互斥机制、中断机制、睡眠机制等，让接受此课程的人可以直接上手嵌入式开发linux的驱动和移植工作。', '4.5linux驱动策略及框架_ABWdWfG.png', '', 0, 6693),
(369, 'Java Web扩展-Maven', 'Maven作为一个项目管理工具，通过约定优于配置的方式提供了提供了统一的目录结构、统一的构建阶段、对第三方依赖库进行统一的版本管理，极大的简化了项目的配置管理难度，提供了Ant之外的另一种选择，得到了越来越广泛的应用。\r\n本套视频教程将从实践的角度带你学习Maven、在使用中理解Maven、理解自动化部署\r\n', '4.6Java_Web扩展-Maven.jpg', '', 0, 16407),
(372, '选修课-NDK初探', 'Android NDK开发是学习怎样使用C与java共同开发Android应用程的技术，有了NDK技术之后，你就可以开发出只用java不能开发的一些特殊项目，因为java不能，而C可以。同时，你就可以有基础去学习Android中间件的开发，因为中间件中大量使用了NDK技术。', '5.5选修课-NDK初探_UrfkCk6.png', '', 0, 6761),
(373, '深度学习基础介绍-机器学习', '本课作为深度学习系列课程的第一阶段，介绍机器学习的基本概念，原理，以及常用算法（如决策树，支持向量机，神经网络算法等）。以Python语言为工具对每种算法进行结合实例讲解。学生学完本课程后将会理解机器学习的常用算法原理，并会使用Python中相关的package来对实际问题进行数据预处理，分类和回归分析。为开发机器学习相关应用打下必要基础，同时也为学习深度学习进阶课程打下必要基础。', '4.8深度学习基础介绍-机器学习.png', '', 0, 2023),
(374, '学习UX第一季-轻松入门', 'UX软件交互式设计，本章将由麦子学院资深UX软件交互式设计师带你围绕客户体验，按照既定设计流程，根据产品目标，运用UX设计工具，完成极具用户体验的产品设计，让你体验不一样的产品交互式设计之旅。', '1.1学习UX第一季-轻松入门.png', '', 0, 7293),
(376, '选修课-c++概述', '在Android、IOS风行的年代，在充斥浮躁、追求速成的年代，如果有一门语言值得我们去沉下心来好好研究，那它应该是C++。\r\n本套视频教程将从实践的角度带你学习C++。在使用中理解C++、理解面向对象思想。\r\n', '5.9选修课-c概述.png', '', 0, 7624),
(377, 'Android 高级Ui之fragment', '本章主要是android高级ui设计之fragment学习，主要介绍android fragment的应用场景、项目创建、替换、移除、实战等等系列操作，让初学者不仅能对fragment的理论知识有一个清晰的认识，同时还让其能掌握fragment相关实战应用，知其然还知其所以然。', '3.7Android_高级Ui之fragment.png', '', 0, 8),
(378, 'Android 高级Ui', 'android高级ui设计课程，涵盖android ui系统控件、第三方控件等高级UI一切控件的使用方法，并从实战方面进行详细剖析，增强大家对android 高级ui的了解与掌握，设计出更完美的android界面。\r\n\r\n', '3.8.-Android-高级UI.jpg', '', 0, 3266),
(379, 'C++面向对象编程', 'C++是在C语言的基础上开发的一种通用编程语言，支持面向对象编程、泛型编程和过程化编程等多种编程范式，在嵌入式应用开发中广泛运用。本套C++视频教程将由麦子学院资深嵌入式开发工程师，带你从实践的角度学习c++，让你领略c++编程语言在嵌入式开发中的魅力所在。\r\n', '5.8C面向对象编程.png', '', 0, 7624),
(382, 'Android面向对象技术', '因为有些Android架构师的对象技术(OOP: Object-Oriented Programming)的底子并不足以应付以应用框架(Application Framework)为基础的新型软件开发模式。因此，高焕堂老师特别针对Android应用框架背后的面向对象观念和技术，进行有系统的完整介绍，期待它能陪伴Android开发者迅速、顺利地发挥Android的巨大潜能。 \r\n    本课程由浅入深，依序介绍OOP的各项观念，以及它对应到Java的语言机制，然后以实例说明它在Android应用框架里的角色和应用情形。所以，几乎每一章都包含三个部分： \r\n     1) 一项OOP观念和技术之介绍。 \r\n     2) 以Java程序来说明它的应用。   \r\n     3) 以Android程序说明它的应用。 \r\n \r\n    由于Android是一个基于OOP的应用框架，其中面向对象技术的运用非常多，活用技巧也很精湛。', '1.4安卓面向对象技术.jpg', '', 0, 2021),
(384, 'Android教程之设计招式之美', 'Android 是一个精美的软件平台，幕后含有许多设计招式，而且交互运用，形成极为精致的架构设计。Android 就像一匹马，如果你只想用它、骑它的话，本教程并非你的好选择。反之，如果你愿意摸它、陪它、爱它、欣赏它的话，则本教程就是你的最佳选择了。俗话说，外行人看热闹，内行人看门道。在本教程中，高老师把你视为准内行人，然后陪你去看Android的设计门道；而不只是陪你看看热闹而已。所谓门道，就是设计招式(或称为设计模式)，它蕴藏了深刻的创意和思路，也含有专家们屡试不爽的手艺和经验。一旦你拥有了创意、思路和手艺，你就迅速成为内行人了。', '3.7安卓设计招式之美.jpg', '', 0, 2021),
(386, 'Android嵌入式底层前言', '在开始学习Android底层嵌入式前要了解的一些概念', '5.12Android嵌入式底层前言.jpg', '', 0, 5),
(387, '三节课了解Android L-你不得不听的技巧', 'Google正式推出Android L后，便掀起了Android系统的新高潮！各种高端技术惊呆了小编！增强的用户中心，智能化用户认证，多任务功能，应用程序调用，亮瞎了开发者，麦子学院为了让大家了解Android L，专门拍摄了Nexus5真机操作讲解，让你快速掌握新技能。', '三节课了解安卓L.jpg', '', 0, 8),
(388, '选修课 - GNU工具简介', 'GUN是嵌入式应用开发常用工具，本章将由麦子学院资深嵌入式开发工程师，带你学习gnu开发基础，掌握gcc、gdb、makefile等技术。', '1.6GUN工具简介.jpg', '', 0, 5),
(391, 'Express', '畅然带你ExpressJS入门。', 'QQ图片20150319171018.jpg', '', 0, 1393),
(393, 'Python课程初探', ' Python是什么？豆瓣和Youtube是用它开发的；美国最流行的三大服务器开发语言之一，最工整最严谨的编程语言，取代Java和PHP的开源趋势语言。\r\n通过这个课程的学习，我们会初步掌握Python语言的使用以及利用Django框架开发出自己的简易Blog系统，初步踏入了Web开发工程师的行列。', '1.4python-开发初探.jpg', '', 0, 5),
(416, 'IOS动画编程', '本章主要是IOS动画编程相关知识的学习，主要介绍了UIViewAnimation基础、视图、动画等相关知识，通过趣味讲解+实战练习，让初学者能快速掌握iOS动画相关知识。', 'WME70EQZ944343HS9ES.jpg', '', 0, 4130),
(417, '零基础玩转Cortex-M系列CPU', '和工程实践紧密结合，课程中会讲述大量的工程知识和物联网开发经验，学成后相当于具备2年的嵌入式系统开发经验；通过本课程的对比讲解法（Cortex-M0，Cortex-M3，Cortex-M4进行对比讲解），可学习Cortex-M全系列（M1除外）CPU的开发，实现一个课程，学习多个系列CPU,包括Cortex-M0，Cortex-M3，Cortex-M4；课程门槛低，只需要有C语言基础，学生和在职人员均可无障碍学习；课程重视对学生的引导，培养学生自我学习的能力，主要教授学生能够独立的分析问题，设计代码，完成项目。\r\n', '2.1CORTEX-M系列CPU.jpg', '', 0, 12470),
(420, 'Cortex-M系列CPU初级实验（1）：CPU世界的出入通道---I/O编程及应用', '本章主要是物联网开发中，Cortex-M系列CPU基础实战演练，通过本课程的学习，将掌握Cortex-M系列CPU的基本操作方式方法。\r\n\r\n', '通道.jpg', '', 0, 12470),
(421, 'HTML+CSS基础入门', 'HTML+CSS是web前端开发基础课程，本章将由麦子学院资深web前端开发工程师为你全面讲解HTML和css的基本属性和用法，带你进入web前端开发的世界。', '1.1HTMLCSS副本_4b2AEzK.jpg', '', 0, 1472),
(422, 'Cortex-M系列CPU进阶实验', '本章是物联网开发中，Cortex-M系列CPU进阶实战操作演练，通过学习，可掌握Cortex-M系列CPU的高级应用开发方法，为物理网开发打下坚实基础。\r\n', '3.2CORTEX-M系列CPU进阶.jpg', '', 0, 12470),
(423, 'linux下usb驱动', '本章主要是嵌入式开发项目开发实战课程中linux系统下usb驱动的学习，主要围绕基本概念、移植方法、传输方式、鼠标驱动的进行详细介绍，全面剖析usb鼠标驱动的各种方法实现。', '5.6_-----Linux-下usb驱动-.jpg', '', 0, 6693),
(424, '快速提升UI设计能力', '适合有平面设计基础的UI设计师迅速进入职场角色，分享UI细节的取舍对产品的影响，同样与之合作密切的UX设计师也可参考一二，通过积累，做出让人无法反驳的设计决定，让用户来说话。', 'VZ6UY5J3OAE0FGEDIP2.png', '', 0, 14433),
(425, 'Web前端开发之HTML+CSS基础入门', 'HTML+CSS基础入门', '1.1HTMLCSS.jpg', '', 0, 1472),
(426, 'Java Web拓展-Spring MVC', 'Spring MVC是一个非常优秀的MVC框架，设计精良，而且性能优秀。已经成为众多企业选择mvc框架的首选。另外大部分的java web应用都会使用spring框架,Spring MVC和Spring框架又是无缝结合。所以Spring MVC的市场前景会非常广阔。', '4.7Java-Web拓展-Spring-MVC.jpg', '', 0, 16429),
(427, 'WEB系统基础', 'WEB系统基础', '2.1web系统基础.jpg', '', 0, 17403),
(432, 'C++面向对象编程', '在Android、IOS风行的年代，在充斥浮躁、追求速成的年代，如果有一门语言值得我们去沉下心来好好研究，那它应该是C++。\r\n本套视频教程将从实践的角度带你学习C++。在使用中理解C++、理解面向对象思想。', '1.1C面向对象编程.png', '', 0, 7624),
(455, '项目制作-简易版QQ', '在android学习过程中，项目开发是重点学习的内容之一，本章就将带领大家一起来进行android项目实战，用android程序开发、制作简易版的QQ，将前几个阶段学习的理论知识，充分在实践中重现。\r\n', '3.9项目制作-简易版QQ.jpg', '', 0, 14098),
(457, 'Tkinter桌面编程', 'Tkinter桌面编程', '3.1Tkinter桌面编程.jpg', '', 0, 5),
(458, 'Python网络爬虫实战-Scrapy', '这是一门网络爬虫实战课程，让我们带你揭开爬虫的神秘面纱，掌握爬虫的基本原理，深入理解scrapy框架，使用scrapy进行项目实战，解决在数据抓取过程中遇到的常见问题。', 'Python网络爬虫实战.jpg', '', 0, 45265),
(460, '项目-Python开发跨平台的记事本', '项目-Python开发跨平台的记事本', '3.2Python开发跨平台的记事本.jpg', '', 0, 5),
(466, '物联网车载应用实战', '本章物联网车载系统应用实战，主要包括车内温湿度的采集、行车姿态的采集  、采集到的数据通过蓝牙发送到手机、对异常的数据进行报警等，将带你进入智能化车载应用时代。\r\n\r\n', '4.1物联网感知端项目实战.jpg', '', 0, 12470),
(469, 'Android蓝牙开发', '从互联网到移动互联网，科技的发展经过一波又一波的浪潮。我们站在浪潮之颠思考未来。 物联网，一个颠覆性革命，已近在咫尺，面对蓝牙的连接，作为物联网的基础纽带，将为您打开这扇门。本将重点学习android蓝牙开发相关技术知识，让你在互联网、物联网的世界更加游刃有余。', '5.6Android蓝牙开发-.jpg', '', 0, 21559),
(472, '嵌入式综合项目-智能家居', '学习嵌入式驱动开发，我们不仅要掌握理论知识，还需要实践的积累，本章我们就带领大家一起来进行嵌入式驱动之智能家居的项目开发。', '5.1嵌入式综合项目-智能家居-_Rc0KuZZ.jpg', '', 0, 4),
(475, 'Swift项目：网络音乐播放器 ', '本章主要是swift项目实战学习，主要学习iOS网络音乐播放器第三方控件的使用、混编及基础界面的实现，将前期所学的swift语言理论知识，学以致用，深化知识点的掌握。\r\n', '4.2ios音乐播放器.jpg', '', 0, 4130),
(478, 'Linux多线程编程', 'Linux多线程技术，嵌入式开发常用技术之一，更好的利用资源，让你的程序相应更快，在多核时代，让你实现真正的并行。', '2.3Linux多线程_hUYScRu.jpg', '', 0, 17985),
(479, 'Linux网络编程项目实战 - 轻量级HTTP服务器', '这是一门Linux网络编程的项目实战课程，目标是让你把知识从“知道”变成“应用”，让你从“会编程”过渡到“会做项目”，让你学会用嵌入式驱动开发工程师的方式来思考和设计。', '5.2Linux网络编程项目实战_-_轻量级HTTP服务器_2gshcZR.jpg', '', 0, 21840),
(480, 'C++面试题', '在Android、iOS风行的年代，在充斥浮躁、追求速成的年代，如果有一门语言值得我们去沉下心来好好研究，那它应该是C++。但是如果要找到一份好的工作也着实不易。\r\n本c++套视频教程将带你了解常见C++面试题目。在遇到自己喜欢的公司时能够抓住机会。\r\n', '5.9C面试题-.jpg', '', 0, 21967),
(481, '项目实战二：android类似大众点评网项目', '学完android编程理论知识，本阶段我们就开始了android项目实战，本章将主要为大家讲解android类似大众点评网项目的制作，让大家能充分掌握项目实战的经验技巧和相关关键知识点。', '5.13项目实战二android类似大众点评网项目.png', '', 0, 22183),
(482, '嵌入式Linux网络编程基础', '这是一门嵌入式Linux网络编程的基础课程，目标是让你从零开始学习网络编程，以及网络编程中的技巧运用，并能熟悉从网络基础中做更高层的开发。', '2.4嵌入式Linux网络编程基础_MWClwim.jpg', '', 0, 22991),
(484, 'android项目实战-汽车门户APP ', '在完成了android基础篇学习以后，我们不禁会去思考，一个商业级别的Android APP项目还会要求我们具备怎样的能力？我们又该如何去掌握并且运用这些能力？本系列android项目实战视频将带领大家完成一个商业级别的APP项目，解决项目中遇见的实际问题，帮助大家成为一个合格的android开发工程师。', '5.14android项目实战-汽车门户APP.png', '', 0, 25657),
(485, '（选修课）探索Android底层开发', '做嵌入式驱动开发，我们不仅要掌握过硬的硬件开发相关知识，也要掌握过硬的软件开发相关知识，本章麦子学院的小刚老师就将带领大家一起探索Android底层开发相关知识，我们一起来学习吧。\r\n', '5.4探索安卓底层开发_PFSnyqJ.jpg', '', 0, 25636),
(486, 'Linux内核及文件系统制作', '嵌入式驱动开发包括硬件子系统和软件子系统两部分，Linux内核及文件系统属于软件子系统，本课程将主要对文件系统的构建与移植进行介绍，讲解如何选择、配置、移植与制作一个可用文件系统及其镜像，以及怎样配合Linux内核的配置来调整应用生成的文件系统，进而掌握构建完整嵌入式驱动软件子系统应用开发环境。\r\n', '4.3linux内核及文件系统制作_Vabyz05.jpg', '', 0, 25650),
(487, 'java servlet 3.0新特性', 'java servlet 3.0新特性', '4.8java_servlet_3.0新特性_9bTDIpo.jpg', '', 0, 25663),
(489, '高级工程师手把手带你做企业门户前端', '这是一门Web前端开发项目课程，手把手教你如何进行企业门户网站开发，你将系统的学到DIV+CSS页面布局，图片广告，图片列表制作，菜单制作，及二级菜单实现原理，轮换广告JS特效，无缝图片列表等的实现。', '2.2手把手带你_做企业门户前端.jpg', '', 0, 26317),
(490, '物联网基础 之 蓝牙4.0 BLE基础', '本课程主要是讲蓝牙的一些基本应用、部分函数及其部分硬件资源的应用，通过对基本的寄存器操作，了解并深化对蓝牙寄存器的操作。主要涉及输入输出控制、串口通信、模数转换、定时器中断以及蓝牙广播等。通过这些内容，可使基本了解蓝牙的工作原理以及协议栈。', '2.2更新中物联网基础_之_蓝牙4.0_BLE基础.png', '', 0, 28260),
(493, '阶段项目：小波赌大小', '小波赌大小', '4.4Swift项目小波赌大小.png', '', 0, 6502),
(494, 'Bottle Web开发', '这是一门介绍Python的WEB编程的微框架Bottle的课程，通过本课程的学习，让你能熟练运用Bottle框架及其各种特性完成中小型WEB服务器项目程序。', '4.9Bottle_Web开发.png', '', 0, 28715),
(495, '初始Objective-C', 'Objective-C开发语言是扩充C的面向对象编程语言，iOS开发是用的Objective-C语言，本专题更系统的讲解Objective-C开发语言当中的一些要点，包括面向对象概念、基本语法、类和对象的关系、类的封装、构造析构函数、self指针、点语法、Category语法、基本数据结构(NSString、NSArray、NSDictionary、NSNumber、NSSet、NSValue、NSData)、继承(基本概念、重写、虚方法)、内存管理(黄金法则、retain点语法、MyArray、AutoreleasePool、浅拷贝详述、深拷贝详述、)、设计模式(单例设计模式、单例各种写法、通知中心、Blocks语法、KVO、KVC)、文件操作(NSManager、NSFIleHandle、归档)等内容。 INSERT INTO `tbl_video` (`id`, `course_id`, `title`, `link`, `video_link`) VALUES
