(496, 'Android HAL编程实战 - 实现自己的HAL', '这是一门Android HAL编码的项目实战课程，目标是通过HAL设计方式分析，代码实战，让你学会用系统架构师的方式来思考和设计。', '5.6实现自己的HAL.jpg', '', 0, 29989),
(497, 'less从入门到精通 ', 'less从入门到精通 ', '2.3less从入门到精通.jpg', '', 0, 1472),
(501, 'OC项目：新闻阅读器APP', '这是一门Swift编程的项目实战课程，目标是让你把swift语言相关知识从“知道”变成“应用”，让你从“会编程”过渡到“会做项目”，让你学会用iOS开发工程师的方式来思考和设计。', '4.5OC项目新闻阅读器APP.jpg', '', 0, 30663),
(502, 'oc项目：驾照助手', '本章主要是objective-c项目实战之驾照助手的学习与开发，主要从OC项目的设计、项目搭建、项目处理及项目功能实现方面进行学习，让iOS学习者能快速将之前所学的objective-c编程语言的基础知识运用于实践中。', '课程封面_cZq7Npy.png', '', 0, 33784),
(504, 'Android Studio', 'Android Studio是Google最新推出的高效Android开发工具，本课程将教会您使用最新的Android Studio开发工具，并且能够快速的从Eclipse迁移到Android Studio。\r\n', '1.2android-studio.jpg', '', 0, 21559),
(505, 'iOS8新特性 扩展(extension)开发', '本课程会学到扩展开发的概念以及每一种扩展提供的功能所适用的范围,加深对app之间的交互的理解,从而对自身app所提供的服务的完善。简化一些功能的开发并激发出创意.', '5.1iOS8新特性-扩展extension开发-.jpg', '', 0, 31582),
(506, 'linux之io系统编程', '本章主要是linux操作系统的io系统编程课程，是嵌入式学习必学课程之一，将由麦子学院嵌入式开发工程师从IO系统的函数、标准及相关操作方面为大家详细介绍，方便初学者快速掌握。', '5.13linux之io系统编程.jpg', '', 0, 32143),
(507, 'Backbone入门基础', '讲述Web前端MVC框架——Backbone的基本使用方法。目标是让学员理解前端MVC思想，掌握Backbone的使用方法，掌握单页面Web应用的开发方法。', '2.4Backbone入门基础-.jpg', '', 0, 32539),
(508, '数据结构面试题', '学习嵌入式开发，不仅要学习嵌入式开发相关的理论知识、能运用这些知识进行实战开发，还需要清楚面试过程中，企业一般都问些哪些问题，这样才能更顺利的进入理想企业。本阶段，我们为大家介绍的就是面试中，数据结构相关面试题的集锦，助你面试更加顺利。\r\n', '数据结构面试题.jpg', '', 0, 34483),
(509, '产品经理内功修炼', '本套课程不同于目前市面上产品经理基本理论的大多数课程，本套课程重在运用产品经理专业理论，解决产品经理工作实际问题，从实际产品开发中的每一个细节探究产品，力求让产品人不再纸上谈兵，要理有据做产品，让产品菜鸟一步步蜕变成产品大神。', '产品经理内功修炼_.jpg', '', 0, 34448),
(510, '零基础学C#开发', 'C#是微软公司在2000年7月发布的一种全新且简单、安全、面向对象的程序设计语言，是专门为.NET的应用而开发的语言，并且做为Unity3d的脚本语言之一，。它吸收了C++、Visual Basic、Delphi、Java等语言的优点，体现了当今最新的程序设计技术的功能和精华。C#继承了C语言的语法风格，同时又继承了C++的面向对象特性。课程全面讲述了C#基础知识，带您进入C#的精彩世界， 了解C#的基础知识及如何快速学习C#，课程内容主要分为以下几部分。\r\n1. C#基础语法，流程控制语句。（变量的定义，数据的类型，字符串处理，集合的处理）\r\n2. C#的面向对象编程（类的定义，方法的应用，四种传参方法，字段的封装，方法的重构，类的继承，静态类，抽象类，接口等）\r\n3. C#的IO处理，事件委托，多线程开发，异常处理等\r\n4. C#对于XML的处理（游戏有可能有Xml的配置文件，需要读取操作）\r\n个人介绍：\r\n钟勇：多年一线.net开发经验以及软件培训经验，成都微软技术中心技术专家之一，国家信息安全产业基地（西部）技术顾问。精通c#技术，php技术，参与项目涉及电子政务系统、网上银行、ERP、CRM、OA等。', '零基础学C开发.jpg', '', 0, 17443),
(511, '电子商务网站搜索开发基础-Lucene', '电子商务网站搜索开发基础-Lucene', '电子商务网站搜索-Lucene_.jpg', '', 0, 16429),
(512, 'swift编程项目实战 – 解锁的设计与实现', '这是一门swift编程的项目实战课程，目标是让你把所学的swift语言理论付诸于实践，让你不仅能设计iOS APP，更让你知道如何去实现APP，培养你iOS工程师的思考和设计方式。', 'swift编程项目实战_.jpg', '', 0, 37298),
(513, '移动前端开发项目', '希望能够通过本套课程的学习，使之前没有接触过移动端开发的同学，能够熟练进行移动端开发，并能拥有差不多2年移动端开发经验，提高同学的前端架构能力。', '移动前段实训课程.jpg', '', 0, 37899),
(514, 'ios团团赚项目', '这是iOS项目实战中介绍团购项目的实践课程，通过该iOS实战课程，你将学会如何来进行iOS项目设计，界面定制及转场动画，多线程操作，地理定位，新浪微博SSO授权登录，本地数据缓存，了解OAuth2.0技术等。', 'iOS团团赚项目.jpg', '', 0, 30663),
(519, '麦子商城项目制作', '学习这个课程，使你能够胜任前端网页工程师岗位，能够熟练掌握网页布局模式以及常用的CSS样式；能根据需求分析，设计JavaScript特效；根据效果图使用DIV+CSS布局出相应的网页。', '麦子商城.jpg', '', 0, 26317),
(524, '项目管理', '这是一门关于项目管理的课程，目标是让你了解现代IT项目管理流程，并且能够针对某个流程设计出一套相关的文档，从而使整个项目规范化和科学化。', '项目管理.jpg', '', 0, 43129),
(528, '产品经理不再纸上谈兵', '本章产品经理视频教程，不同于目前市面上产品经理基本理论的大多数课程，本套课程重在运用产品经理专业理论，解决产品经理工作实际问题，从实际产品开发中的每一个细节探究产品，力求让产品人不再纸上谈兵，要理有据做产品，让产品菜鸟一步步蜕变成产品大神。', '产品经理不再纸上谈兵.png', '', 0, 34448),
(530, 'Cortex-M系列CPU初级实验（2）：CPU世界和外界的桥梁---串口编程及应用', 'Cortex-M系列CPU初级实验（2）：CPU世界和外界的桥梁---串口编程及应用\r\n', '桥梁.jpg', '', 0, 12470),
(531, 'Cortex-M系列CPU初级实验（3）：CPU世界的守护者和计时器---看门狗和定时器编程及应用', 'Cortex-M系列CPU初级实验（3）：CPU世界的守护者和计时器---看门狗和定时器编程及应用\r\n', '守护者.jpg', '', 0, 12470),
(532, 'linux进程概述', '多线程和多进程，无论在嵌入式领域，还是应用开发领域，都是不可避免要设计和使用的。\r\n本套视频教程将从实践的角度带你深入理解什么是线程，什么是进程。如何更好的使用好多线程和多进程。', '5.15linux进程概述.jpg', '', 0, 43811),
(533, '利用Sass编写高质量CSS', '这是一门CSS相关的进阶教程，目标是让你把知识从“会用”变成“用好”，让你从“会写代码”过渡到“会写高质量代码”。\r\n', '用SAAAA.jpg', '', 0, 43776),
(534, 'JBPM从入门到高级开发', '该课程讲解了jbpm基础知识和高级开发，包括jbpm和spring，hibernage集成等。还讲解了一个jbpm的web流程设计器。', '4.9JBPM从入门到高级开发.jpg', '', 0, 44064),
(535, '企业网站后台制作实战', '企业网站后台制作实战', '网站后台.jpg', '', 0, 43842),
(536, 'KnockOut从入门到精通', '这门课程会帮助你学会正确的使用KnockOut框架，可以熟练运用KnockOut框架开发实际项目，提高项目的开发效率，使项目更易维护和扩展。', '1.7KnockOut从入门到精通.jpg', '', 0, 44137),
(539, '电子商务网站搜索开发基础-Lucene', 'Spring MVC是一个非常优秀的MVC框架，设计精良，而且性能优秀。已经成为众多企业选择mvc框架的首选。另外大部分的java web应用都会使用spring框架,Spring MVC和Spring框架又是无缝结合。所以Spring  MVC的市场前景会非常广阔。', '_Lucene.jpg', '', 0, 16429),
(541, '蓝牙4.0BLE开发---智能灯泡+万能遥控器 ', '通过前面基础课的学习，本课程主要是针对前面已有的蓝牙知识基础，进行项目实战进阶式开发，开发项目包括智能灯泡与万能遥控器，以及对防丢器与ibeacon开发的引导式介绍。通过本课程，可以让你学到贯穿整个项目开发的全部阶段的内容。学了本课程，可以让你独立开发基于普通单片机以及蓝牙等系列的产品。本课程中，会加入一些国产单片机的内容，内容充实，学完直接可以上岗就业，进公司就可高薪。 ', '蓝牙4.0BLE开发---智能灯泡万能遥控器.jpg', '', 0, 28260),
(543, 'bootstrap综合实战', 'bootstrap综合实战', 'bootstrap综合实战.jpg', '', 0, 1472),
(544, 'django项目实战之购物系统', 'Python，一个比Java更早4年的语言，近年来被人们熟知，它的优雅与快捷给人们留下了深刻的印象。\r\n本课程将使用Python语言与Django Web开发框架搭建一个强大的购物系统。通过本项目的学习，全面系统地掌握使用Django开发出功能强大的网站，\r\n更重要地是让学员掌握Web开发从设计到部署的一整套流程，有能力根据自身需求去实现功能或者在现有基础上进行扩展。', '2.9django项目实战之购物系统.jpg', '', 0, 45808),
(545, 'Python 面向对象编程', '这是一门介绍Python的面向对象编程的的课程，通过本课程的学习，让你能熟练运用Python语言通过面向对象编程，并运用其面向对象特性，以高效率的方式完成编程项目程序。', 'Python-面向对象编程-.jpg', '', 0, 28715),
(546, '产品经理的自我修养', '本套课程不同于目前市面上产品经理基本理论的大多数课程，本套课程重在运用产品经理专业理论，解决产品经理工作实际问题，从实际产品开发中的每一个细节探究产品，力求让产品人不再纸上谈兵，要理有据做产品，提升产品经理的自我修养，让产品菜鸟一步步蜕变成产品大神。', '产品经理的自我修养.jpg', '', 0, 34448),
(547, 'Android5.0/5.1新特性', 'android 5.0 是Google历年来改动最大的版本，带来了全新的用户体验与功能提升，本课程将给大家介绍android 5.0中最炫的Material Design的实现方法及部分重要的API使用。', 'Android5.05.1的新特性.jpg', '', 0, 21559),
(551, 'Android层次分析 –从顶层到底层', '本课程通过结合实例代码来分析Android是怎么由应用一步步到底层的，以把Android OS纵向地串接起来。同时会把学习的思路融入课程，让你不仅仅知道答案是什么，更进一步知道怎么去获取答案。\r\n\r\n在课程结束的时候你将知道从应用到底层分别是什么样的，以及是怎么一层层下来的。可以让你对整个Android系统有个直观的认识，为日后根据个人兴趣选择进入Android各层开发打下基础。', '从顶层到底层.jpg', '', 0, 50080),
(552, 'JSON入门', '本课程是一门关于JSON的入门级教程。JSON在2001年被提出，是一种用于数据交换的文本格式，相比XML具有很多显著的优点。通过本课程的学习，你能够了解JSON的格式规则、在网页前端的简单应用、以及常见的扩展格式。', 'JSON入门.jpg', '', 0, 50268),
(555, '响应式web设计及项目实践', '这是一门从入门到精通由浅入深步步深入的理论+项目实战的课程，让你短时间内学习WEB的最基础知识和底层知识及如何去搭建响应式WEB项目的方法。项目案例的制作会让你的知识进一步巩固和升华，在掌握一些HTML,CSS,JS浏览器基础和当前流行的响应式设计技术的同时，为你技术的提升添砖加瓦。', '4.9响应式web设计及项目实践.jpg', '', 0, 50324),
(559, 'Web应用安全 ', '本课程主要讲解web应用安全知识，目标是让学员了解web应用方面的安全问题。未知攻焉知防，本课程将从“黑客”攻击角度来讲解如何防御，以保障数据信息安全。', 'Web应用安全.jpg', '', 0, 51116),
(566, '电子基础元器件', '电子产品在我们的生活中无处不在，并且随着科技的发展创新产品层出不穷。如果我们可以掌握一门技术，那么在电子产品的行业中，我们将是这个科技爆发时代的弄潮儿。\r\n本套视频教程主要是从硬件工程师的基础讲起，为零基础的学习者设置零门槛，带领大家学习基础知识的同时，引导大家从身边常见的电子产品中认识和实践各种电路。', '电子基础元器件.jpg', '', 0, 51615),
(570, 'Webpack实战', '如果你从事的是大型项目的开发，有复杂的模块依赖，那么你一定需要Webpack；如果你想要简单设置，容易上手的工具，那么你也一定需要它；如果你想要更快的打包效率和开发效率，它可以让你不刷新页面就能看到代码修改的结果。Webpack凭借自身的特点与优势，在Facebook开发团队的全力推广下，已经成为了当前最好的前端打包工具之一。', '3.10Webpack实战.jpg', '', 0, 53001),
(571, 'C语言及程序设计快速入门', 'C语言及程序设计快速入门', 'C语言及程序设计.jpg', '', 0, 12470),
(572, '深度学习进阶：算法与应用', '算法与应用 。', '4.12算法与应用.jpg', '', 0, 2023),
(573, 'Python 数据库编程', '本课程首先介绍了Python语言中的数据库接口规范（2.0版），之后通过Python标准库中的sqlite3模块进一步学习Python中操作SQLite3数据库；接着介绍操作MariaDB及ORM框架sqlalchemy的使用方法;最后重点介绍Python操作MongoDB数据库的方法。\r\n通过本课程的学习，使你能够胜任Python操作各类数据库编程，以期在各类项目中的应用。', 'Python-数据库编程.jpg', '', 0, 28715),
(574, '产品经理从专能到全能', '本章产品视频教程主要是帮助大家，掌握产品经理相关的知识（交互、UI、运营、用户体验等），将产品思维贯穿产品开发的每一个环节，从更高的角度提升产品整体层级。', '产品经理从专能到全能.jpg', '', 0, 34448),
(576, 'python自动化运维+web监控系统', '这是一门python自动化运维及监控系统的实战课程，目标是让你了解自动化运维的好处，原理。', 'python自动化运维web监控系统.jpg', '', 0, 56458),
(577, '使用pyqt开发windows gui程序及打包', '这是一门python GUI编程的项目实战课程，目标是让学员学会使用pyqt设计基本的GUI程序，让你从“不知道python能干什么”和“学完了基础语法不知道再学什么”过渡到知道“python能做任何事情”和“我学的还不够多”，以实际程序带你走进python开发GUI程序的世界。本课程既是对基础语法学习的一个检验，又是对python编程的提高。', '使用pyqt开发windows-gui程序及打包.jpg', '', 0, 56957),
(579, 'Mock.js+Express实现京东商城数据模拟', '这是一门利用Mockjs+Nodejs开发框架快速实现基于业务的数据模拟项目的课程。课程实践项目来源于真实的商业案例，通过课程的学习，让大家对Nodejs、数据模拟等前沿技术有更深入的了解，并在实际项目中发挥其重要的作用，让大家能够掌握Express快速搭建跨平台的MVC开发框架，快速构建自己的数据模拟系统。同时学会利用互联网和开源社区迅速扩大自己的技术视野，在课程中教会大家如何分析并解决问题。', 'Mock.jsExpress实现京东商城数据模拟.jpg', '', 0, 59404),
(580, 'Javascript 进阶', 'web前端开发之----javascript 进阶', 'javascript进阶.jpg', '', 0, 4290),
(581, 'Javascript 进阶', 'web前端开发之----javascript 进阶', 'javascript进阶_A7H7vnU.jpg', '', 0, 4290),
(583, 'JavaScript面向对象编程', '在这个js大行其道,各种前端js框架如jQuery ,Ext,prototype等广泛运用在各个Web项目中的世界中,js面向对象的特性被深度挖掘的年代中,没有对js面向对象的深入了解,你都不好意思说你会js。\r\n本套视频教程将从面向对象的角度带你学习js 。在使用中理解js的面向对象的一面,并能掌握js中的三大重点与难点:原型,this,闭包,具备读懂jQuery框架源码的基础,并能以面向对象的形式编写js。', 'javascript面向对象编程.jpg', '', 0, 61056),
(584, 'Openfire+Smack Android 即时通讯应用开发', '本课程为android应用企业级即时通讯开发框架基础，完成该android实战课程后，可以达到以下目标：\r\n1 、掌握 xmpp协议基础知识 ；\r\n2 、能独立安装、配置openfire 环境； \r\n3 、能独立开发、部署 基于openfire+smack Android IM应用；', 'openfiresmack-Android-即时通讯应用开发.jpg', '', 0, 33515),
(585, ' ECMAScript6编程艺术', 'ES6中包含了许多新的语言特性，它们将使JS变得更加强大，更富表现力。接下来，我们将一一深入了解它们。', '4.4ECMAScript6编程艺术.jpg', '', 0, 61453),
(591, 'MemCache', '主要介绍一下MemCache的一些常用的操作命令和在项目中的一些实战。', 'MemCache.jpg', '', 0, 43129),
(592, 'Linux进程间通信 ', '进程，程序灵魂的载体，掌握了linux的进程及特性，以及他们之间的信息传递，将是成为一名合格的linux应用开发工程师必须的技能。', 'Linux进程间通信.jpg', '', 0, 32143),
(593, '基于百度壁纸的UI设计实战', ' 本课程主要通过百度壁纸的案例，讲述Android ui设计中的基本控件、自定义控件和自定义组合控件的简单使用，各个衔接模块通过案例举一反三，同一模块通过多种技术实现，增强学生对技术的一个认知和了解，同时让学生对Android技术产生浓厚的兴趣，真正的体会Android界面设计的布局之美。', '基于百度壁纸的UI设计实战.jpg', '', 0, 63910),
(594, '热门产品分析', '1.认识互联网各分类行业的发展现状\r\n2.了解互联网热门产品的设计和发展\r\n3.对热门产品进行竞品分析\r\n4.学习优秀互联网产品的成功经验', '5.8热门产品分析.jpg', '', 0, 34448),
(596, 'HTML5绘图', 'HTML5提供了Canvas元素，允许脚本语言动态渲染位图像。Canvas由一个可绘制地区HTML代码中的属性定义决定高度和宽度。JavaScript代码可以访问该地区，通过一套完整的绘图功能类似于其他通用二维的API，从而生成动态的图形。本课程详细讲解了HTML5绘图的基本方法，包括文字、路径、图像和渐变等内容，最后以一个单机版的五子棋项目来证明HTML5绘图功能的强大。', 'HTML5绘图.jpg', '', 0, 21557),
(616, 'Wifi音响DIY', '这是一门智能硬件WIFI音响项目实战课程，目标是让初学者简单的步入WIFI硬件开发，让你从“硬件开发新手”过渡到“硬件开发项目”，让你明白硬件开发并非很难，只需了解原理动手DIY就可以实现。', 'wifi音响.jpg', '', 0, 68229),
(621, 'Web前端开发规范', 'Web前端开发规范，可以帮助同学们，了解web前端开发规范的意义，掌握前端开发中的开发规范，掌握web前端开发中的实用技巧。面对企业团队开发，可以很快融入团队合作中，高效率的完成团队给予的任务。', 'web前端开发规范.jpg', '', 0, 26317),
(644, 'Python :socket and threading', '本课程主要介绍Python标准库中的socket(套接字)模块、socketserver模块和threading(多线程)模块的相关知识及其在项目中的应用。课程从计算机网络基本理论介绍开始，并以一个小项目的完成贯穿整个教学过程，来循序渐进的学习这些模块的使用；通过本课程的学习能够让你掌握运用Python语言开发各种高效运行的网络应用程序的基本技能。', 'Python-socket-and-threading.jpg', '', 0, 28715),
(645, 'Python 爬虫基础', '	小到从网络获取一些感兴趣的数据，大到搜索引擎，都能看到爬虫的应用。爬虫的本质就是利用程序自动地从网络获取感兴趣的信息，爬虫技术是大数据和云计算的基础。\r\n	这门课将带你走进爬虫的世界。在这门课程里，您将领略到怎么样通过几十行的 Python 代码从网络获取有趣的数据。', 'Python-pcjc.jpg', '', 0, 77199),
(647, 'Ucos商业实战项目', '本课程以UCOS为基础，详细讲解基于UCOS的项目开发过程。学会使用UCOS开发物联网产品。', 'ucos.jpg', '', 0, 33547),
(648, 'Gulp+Angular+Express实现简易任务管理系统', '这是一门利用JavaScript进行前后端开发的进阶教程。教程中用到了较多比较常用和实用的前端技术、框架，工具等。\r\n目标是让大家了解如何利用JavaScript进行前后端开发，前后端如何交互，以及如何实用前后端构建来提高开发效率。', 'GulpAngularExpress.jpg', '', 0, 43776),
(666, '原画设计师必备工具讲解 PHOTOSHOP基本操作和绘画使用 ', '掌握PHTOPSHOP这一概念设计师常用工具的基本操作和绘画使用。', '1.1.png', '', 0, 3287),
(669, '造型的逻辑基础 几何体绘制', '掌握如何利用之前的学过的形体表现的知识绘制简单的形体造型。', '1.5.png', '', 0, 3287),
(670, '设计色彩基础 色彩理论基础', '通过简单的静物绘制学习绘画以及设计当中的色彩理论基础。', '1.4.png', '', 0, 3287),
(671, '造型与色彩的实践 色彩静物绘制', '通过较为复杂的静物组合绘制，训练造型与色彩相结合的处理手法。', '1.6.png', '', 0, 3287),
(673, 'Python3.X新特性', 'Python 3.X，也被称为 Python 3000 或 Py3K是 Guido van Rossum 通用编程语言的最新版本。新版本对核心语言做了很多改进，打破了与 2.X 版本的向后兼容性。本课程将要对新版本的特性做详细介绍，以便开发者在使用Python时避开版本中一些常见的陷阱，也方便开发者移植Python项目。', 'Python-3.jpg', '', 0, 79245),
(675, '麦子学院游戏原画&概念设计课程介绍', '麦子学院游戏原画&概念设计课程介绍。', 'mzxy.jpg', '', 0, 3287),
(688, 'paramiko基础', '在实际项目开发过程中不同机器间的操作不可避免，如何高效进行交互甚至自动化运维，我们可以利用paramiko这个利器。本套视频教程将从实践的角度带你学习paramiko。不仅教会原理，而且让你学会结合python高级技巧进行paramiko操作并有源码分析的高级进阶让你眼前一亮。', 'paramiko.jpg', '', 0, 93185),
(691, '安卓应用开发-Activity', 'Android智能手机的迅猛发展，巨大的市场份额激发很多传统IT公司转向APP应用开发，未来十年Android APP开发工程师仍然是炙手可热的职位。本课程将通过实践教会你Andriod应用开发最常用的元素-Activity，快速入门Android应用开发。', 'Activity.jpg', '', 0, 93933),
(692, 'Python自动化开发-类Zabbix监控项目开发与实战', 'Python 已成为IT自动化领域使用最火的语言，它的简洁、高效、易学让众多Pythoner爱不释手，但Alex发现很多运维人员对于Python的使用仅限于编写一些常用脚本，编写相对复杂的自动化工具和程序时就力不从心了，SO Alex决定通过带大家开发一个自动化监控的项目来帮助大家提高 Python自动化项目的架构设计和开发能力，通过本课程，你将会学到以下内容：\r\n1.常规监控系统架构设计和原理；\r\n2.在设计自动化程序的架构时应该注意问题；\r\n3.怎样在开发过程中将程序各模块做到最大程度解藕以便于日后的扩展；\r\n4.如果通过Python + Django 打造支持高并发的分布式监控程序。', 'Python-Zabbix.jpg', '', 0, 94204),
(693, '前端进阶指南 ', '学了很久的前端但是只会从页面找1个元素在上面绑1个事件？如果是这样，那你还有很大的提升空间，本课程由浅入深讲解网络和浏览器的基本工作原理，更为你介绍常见的前\r\n端开发工具、调试工具、性能诊断工具，教你如何解决定位常见的跨浏览器、跨平台兼容问题，还会详细介绍前端性能优化的典型手段。如果这些你都学会了，下次出去面试肯定获得不错的评价。', 'qdjjzn.jpg', '', 0, 72280),
(695, 'Linux内核移植入门', '这是一门Linux内核移植课程的入门讲解，主要目的是了解内核移植过程及在移植中需要涉及的几个基本工具脚本的使用', 'Linux.jpg', '', 0, 4),
(696, 'web测试项目实战', '随着Web 2.0技术的迅速发展，大部分软件产品均基于web开发。因此，web测试在整个测试过程中有着重要的地位，但由于web测试点非常多，测试过程复杂，技术要求高，所以需要对web进行系统理论的实践学习。\r\n本套视频教程将从实践的角度带你学习WEB测试。在测试过程中理解WEB测试、掌握WEB测试的技术方法，形成WEB测试思维。', 'web-csxmsz.jpg', '', 0, 94940),
(697, '原画绘制的秘密 复杂造型中的逻辑思维', '原画绘制的秘密 复杂造型中的逻辑思维。', '1.7.png', '', 0, 3287),
(701, 'MUI项目实训-社交APP的设计', '从想法到创意，从创意到执行，从思路到细节。想要把你的设计能力发挥到实际工作中，你需要的不仅仅是软件和铅笔，一套优秀的工作方法同样重要。\r\n本课程带你从完整的项目中学习真正的职业化设计师工作流程和方法。', 'sjapp.jpg', '', 0, 95823),
(702, 'webUI设计', '这是一门webUI设计入门课程，目标是让你把原来模糊的概念变得精确， webUI设计是一项怎样的工作，这门技术能够和需要完成哪些工作？学完本课程后相信你一定会有一个非常直观的体验。', 'web.png', '', 0, 96276),
(703, '玩转高级图标设计', '这是一门图标制作的进阶课程。通过Photoshop的布尔运算，图层样式等技能，iOS与Android图标规范，来制作拟物化写实图标。', 'wzgjtbsj.png', '', 0, 98671),
(704, '设计基础理论', '让学员对设计有一定的设计基础，对色彩认识和搭配，版面布局和规范，还有创意思维都能有一定的理解，为以后学习和进修设计打下牢固的基础。', 'sjjcll.png', '', 0, 98673),
(705, 'PhotoShop实战', '通过实战案例，让学生了解并掌握PhotoShop基本操作，让学生能够使用PhotoShop完成基本的平面设计、网页设计、广告设计等设计类项目，同时为学生晋升高级UI打下坚实的基础。', 'PhotoShop-sz.png', '', 0, 98682),
(709, 'Python数据可视化分析 - matplotlib', '主要介绍在python中，如何使用matplotlib进行数据的可视化分析。通过该课程，学员可以掌握基本的数据可视化分析手段，比如各种简单统计图绘制、调整图形的外观、绘制多图等技巧，并能独立完成综合性的实战项目。', 'Python--matplotlib.jpg', '', 0, 96328),
(710, 'swift2.0-iOS玩转UIKit', 'swift2.0-iOS玩转UIKit', 'swift2.jpg', '', 0, 33784),
(723, '图标理论基础', '图标是UI的重要组成部分之一，随着扁平化发展的趋势，图标的简洁和表达的含义也越来越被人注重。本次课程先从理论上来聊聊图标的基础知识，希望大家对IOCN设计能有更深的理解。', 'tblljc.png', '', 0, 99444),
(724, 'polymer入门教程 ', 'ES6的标准通过，整个Web开发群都应该尝试新的东西了，那么我们就试试 家 直期待的Web Component，使 Google公司提供的polymer, 切都变得清晰简单了。Let’s do it。', 'polymer-rmjc.jpg', '', 0, 97825),
(726, 'Python :Pexpect库应用', 'Python :Pexpect库应用', 'Python--Pexpect.jpg', '', 0, 28715),
(727, '移动UI设计规范', '本套课程主要讲解移动端UI设计规范，分IOS和安卓两种系统。让学员了解它们的设计规范和制作方法，并学会制作和包装出自己的一套APP作品', 'ydui.png', '', 0, 99437),
(728, '交互设计之原型设计', '随着我国互联网行业迅猛发展，互联网公司中不同职位的界定愈发清晰，对员工的专业能力需求也愈发突出，Axure RP7是行业中最知名的原型设计工具之一，熟练使用Axure是成为UX设计师甚至产品经理的先决条件。\r\n本视频通过真实案例，循序渐进的帮助你学习掌握Axuer。', 'jhsj-yxsj.jpg', '', 0, 98151),
(729, '图形图像基础', '如果你想进入到设计这个行业，那你的第一步就是了解图形图像相关的基础知识。如果你已经是一个设计师，那就更应该系统全面的整理有关图形图像设计相关的基本概念。本次课程将为你全面的介绍图像格式、分辨率和像素、以及色彩设计的相关知识。帮助你入门设计，成为一个理论实践一手抓的优秀设计师。', 'txtxjc.png', '', 0, 103809),
(731, 'CS软件界面设计', '通过本课程，学员可以掌握CS软件界面设计理论，设计流程、沟通技巧等知识点，通过大量的案例分析对比，对CS软件界面设计有一个整体的认知。\r\n学习之后，学员基本能够掌握CS软件界面的设计方法，对于将来的项目很容易上手。\r\n', 'csrjjmsj.png', '', 0, 99593),
(734, 'Echarts和highcharts的使用', '主要是介绍一下我们工作中在需要可视化统计数据的时候，我们需要用到的两款比较主流的图表插件，两款插件提供了丰富的实例和详细的API说明，基本上满足了我们的可视化需求。', 'Echartshighcharts.png', '', 0, 43129),
(735, '电商软件APPUI设计', '本课以”MaiYa”电商APP为案例，讲解实际项目电商APP的UI设计和设计流程，目标是学会独立分析项目，了解APP交互设计的原理，掌握独立完成企业级应用项目的技能。', 'dsrj-APP.png', '', 0, 101303),
(736, 'AngulaJs从入门到实战', '学会正确的使用AngulaJs框架，可以熟练运用AngulaJs框架开发实际项目。', 'AngulaJs.png', '', 0, 44137),
(738, 'UI设计理论基础', '  不管你是设计小白，还是准备转行深入学习的新手，基础理论都是你以后发挥创造的基石。本门课程带领学员了解UI设计行业的整体概念，熟悉UI设计行业细分所属基础理论，真正掌握UI设计理念。学以致用，有效提高对设计理念及方法的运用。', 'Ui1.png', '', 0, 103867),
(739, 'AI基础操作和实例', '在UI设计中，我们使用AI这一矢量工具软件，制作效果图，banner，图标绘画等，本次学习主要通过一些教学示例来掌握AI 的基本操作，和了解设计创作过程中，需要注意的细节和技巧。\r\n', 'AI.png', '', 0, 51380),
(740, 'AE动效设计概论和实操', '通过本课程，可以让学员们了解动效设计的原理，并掌握基础交互动画设计，以及能够独立完成交互动画；最后在项目中能熟练使用Adobe After Effects，为团队带来价值。', 'dxsj.png', '', 0, 103752),
(741, 'Android Studio 开发起手式-HelloWorld二三事', '本系列课程将通过一个HelloWorld实例教会大家如何快速新建自己的Android工程，\r\n介绍Android Studio工程目录结构，并分析工程目录中各部件的作用\r\n通过Logcat打印日志，方便开发者观察程序是否如我所愿的运行，debug模式添加断点调试应用程序，常用的adb命令，DDMS工具分析应用程序的性能.', 'Android_XX3zL0o.png', '', 0, 93933),
(742, '移动UI设计实战', '带你了解手机主题设计的发展前景，介绍相关几大设计模块，熟悉掌握手机主题设计的流程、思路和设计原则。', 'ydUIsjsz.png', '', 0, 76063),
(743, '空间的绘画性表现 空间结构与透视的理论基础', '课程描述：掌握形体在空间中的结构与透视变化的理论基础。', '1.2_Z1QRMwd.png', '', 0, 3287),
(744, 'Android数据存储基础', '详细介绍Android的存储机制实现。使用小项目的形式呈现知识点的运用。', 'Android-sjjc.png', '', 0, 22183),
(745, '图标实战', '图标是UI的重要组成部分之一，随着扁平化发展的趋势，图标的简洁和表达的含义也越来越被人注重。本次课程整理了一些常见图标的设计实例教程，希望大家对课程的学习来了解图标设计的一般步骤和过程，从而对图标设计有更深层的了解。', 'tbsz.png', '', 0, 99444),
(747, 'Gevent', 'gevent是一个著名的开发框架。通过本课程可以学习到gevent的各个组件的原理、使用方法及高级技巧，并在实践中掌握gevent的应用场景，最后通过部分源码分析彻底掌握多开发编程的核心技巧。', 'gevent.png', '', 0, 93185),
(748, '玩转sketch', '课程描述：这是一门实用sketch设计界面的实践任务，目标是了解UI设计，提高效率，熟练应用sketch，让你专注于UI设计的核心。', 'wz-sketch_z5g7eaG.jpg', '', 0, 14433),
(749, '前端工程化', '  现如今前端领域遍地开发，想要构建自己的工程化工具体系还真是不容易，本课程会详细介绍我在工程实践中积累出来的工具箱，从前端项目的初始化到开发，再到测试、构建、部署和监控等环节的事半功倍的工具，认真学完，相信你的个人生产力、代码质量都会上1个台阶，能力提升了，升职和加薪还会远么？', 'qdgch_A40YjLh.png', '', 0, 72280),
(750, '新闻类APP项目设计', '清楚一款新闻APP诞生前后，作为一个设计师所起到的作用以及在这个APP诞生的过程中设计师需要掌握的一些设计技能和产品思维方式。', 'app.png', '', 0, 104627),
(751, 'pandas教程', 'Pandas是python的一个数据分析包，最初被作为金融数据分析工具而开发出来，因此对时间序列分析提供了很好的支持。目前 Pandas 已经成为 Python 语言里最强大的数据分析工具包。\r\n	你是个价值投资者，你想分析所有股票的平均年化收益率，从而给你选股提供决策数据？你是GTD践行者，你每年年底都要统计一下这一年来你的时间都去了哪儿？Pandas 将是这些任务的理想工具。', 'pandas-jc.png', '', 0, 77199),
(752, 'Android网络编程基础', 'Android网络编程', 'Android-wlbcjc.png', '', 0, 25657),
(753, '真实形体的空间表现 光影绘制理论基础', '课程描述：掌握如何在光影表达的前提条件下绘制简单的形体造型 。', '1.3_dkdcOGe.png', '', 0, 3287),
(754, '仿iMessages聊天界面开发 ', '通过实战iMessage应用来深入学习与掌握UITableView控件的使用技巧，课程中将深入浅出的介绍基于表格视图应用程序界面的数据模型设计、cell搭建与设置、布局的自适应、表格视图编辑与分区、调用系统通讯录，相册等知识。 ', 'iMessages.png', '', 0, 33784),
(756, '交互设计基础', '如果说UI设计是近期最火热的职业，那么交互设计便是UI设计师的核心竞争力。在此课程中，同学们将接触到一线互联网公司的交互设计流程，了解交互设计原则，真正掌握用户体验的含义。学以致用，有效地提高对产品及需求的理解。', 'jhsjjc.png', '', 0, 107401),
(761, '产品经理概论和主要职责', '该课程主要是通过介绍什么是产品经理，成为产品经理所需要具备的条件是什么。本课程的主旨是：使即将步入产品经理这个岗位的学员认识到产品经理在团队中所扮演的角色，以及如何扮演好这个角色。', 'cpjl.jpg', '', 0, 111968),
(763, 'MUI项目实训-互联网企业网站设计', 'MUI项目实训-互联网企业网站设计', 'qywzsj.png', '', 0, 95823),
(767, 'ios图片浏览器', 'ios图片浏览器', '2.jpg', '', 0, 33784),
(768, 'UIKit练习-仿网易新闻首页', '开发一个应用很容易，开发一款便于维护又便于扩展的应用很难。这门课程以模仿网易新闻客户端首页为引子，带你进入到规范化的，工程化的应用开发流程中，在教会你基本的功能及页面的实现的同时也教会你如何写出便于维护的代码。', 'UIKitlx.png', '', 0, 113670),
(770, 'UIKit练习课程-仿微博界面', '本节课程将会教给大家UITableView的使用，如何定制Cell，如何计算Cell的高度，如何做图文混排以及如何在项目中灵活地使用Swift2.0进行编程。', 'UIKitlx.jpg', '', 0, 114146),
(772, 'swift 2.2 基础', 'Swift是Apple公司2014年推出的开发语言，之后不断更新迭代并开源，越来越多的开发者对swift充满信心并热切学习，相信在不久的未来，Swift将成为ios开发的标准语言。当前swift已经更新到2.2版本，本次课程将带领大家掌握并熟练运用swift2.2语法特性，深入理解并掌握swift中函数编程，oop编程和pop编程。', 'Swift-2.2jc.jpg', '', 0, 93185),
(774, '用户体验设计概论与实操', '掌握PhotoShop、axure的操作，理解用户体验在产品设计中的重要性和具体实践操作的方法、技巧等。', 'yhty.png', '', 0, 114857),
(775, '移动UI设计实战', '学习PhotoShop及Cutterman、Markman、.9切图、标注UI界面\r\n掌握PhotoShop、Cutterman、Markman的操作和实践上的知识和技巧。', 'Nina.png', '', 0, 114857),
(778, '移动UI设计规范（下）', '移动UI设计规范（下）', 'gfx.png', '', 0, 99437),
(779, '人体与幻想类角色结构绘制', '人体与幻想类角色结构绘制', 'rtyhxjsjghz.jpg', '', 0, 3287),
(782, 'Git 与 GitHub', 'Git是一个分布式的版本控制系统， 起初用作Linux内核代码的管理,而现在在其他项目中也取得了很大的成功.。Github作为git库最大的托管平台， 拥有百万的开发者,，海量的开源代码,，是大家学习和工作很好的平台,，所以不管学习什么语言,，掌握Git相关的知识是开发者必备的技能。', 'git_hub.png', '', 0, 78680),
(815, 'Android数据存储实战', '详细介绍Android的存储机制实现。使用小项目的形式呈现知识点的运用。', 'Android-sjsz.png', '', 0, 22183),
(816, 'Android网络编程实战', 'Android网络编程', 'Android-wlbcsz.png', '', 0, 25657);

